import image from './banner.png';
import './App.css';
import About from './About';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className='banner'>
        <img src={image} className="banner-image" alt="banner" />
        </div>
      </header>
      <About/>
    </div>
  );
}

export default App;
